Sure! To solve this problem, we can iterate through the numbers from 1 to 500 and check if each number is a perfect square and if its upside-down version is also a perfect square.

Here's the Python code to find the bus number:

```python
def is_perfect_square(n):
    return int(n**0.5)**2 == n

def is_upside_down_perfect_square(n):
    upside_down = str(n)[::-1]
    return is_perfect_square(int(upside_down))

for bus_number in range(1, 501):
    if is_perfect_square(bus_number) and is_upside_down_perfect_square(bus_number):
        print("The bus number is:", bus_number)
```

When you run this code, it will output the bus number that satisfies the given conditions.
